# logic: to maintain the array of 4 length and then get the max by moving it and to track teh start as it is a contiguous one
# leanred logic: to first calculate the sum of k and then and add & subtract the edge elements for better performance and speed
def findMaxAverage(nums, k):
    len_nums=len(nums)
    summ = sum(nums[:k])
    max_value = summ
    if len_nums==1:
        return nums[0]
    for i in range(1,len_nums-k+1):
        summ-=nums[i-1]
        summ+=nums[i+k-1]
        max_value=max(max_value, summ)
    return float(max_value/k)

